import logo from '../image/Logo-Elibs.png'

const Header = () => {
    return (
        <div class="bg-[#2A3342] fixed w-full top-0 z-50">
            <div class="py-5 flex w-full items-center">
                <div class="flex justify-between w-full mx-[150px]">
                    <img class="h-10" src={logo} alt="Logo" />
                    <div class="pt-2">
                        <button type="submit" class="border flex border-[#c52222] hover:bg-[#9d1e1e] px-3 py-2 rounded-xl bg-[#c52222] text-white">Log Out</button>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Header;
